import React from 'react';

const DashboardAdminPersonnels = (props) => {

    const OuvrirCreationPersonnels = () => {
        props.ouvreCreationPersonnels("true");
    };

    return (
        <div>
            <button onClick={handleClick}>Composant enfant</button>
            <p>Propriété du parent : {props.data}</p>
            <h3 className="dashboard_text"> Voir personnels </h3>
            <p className="dashboard_text" onClick={OuvrirCreationPersonnels}>Créer</p>
            <p className="dashboard_text">Modifier</p>
            <p className="dashboard_text">Supprimer</p>
        </div>
    );
};

export default DashboardAdminPersonnels;
